import React from 'react';
import ReactDOM from 'react-dom/client';
import { BrowserRouter, Routes, Route } from 'react-router-dom';

import App from './App.js';
import { Auth } from './components/Auth.js';
import Register from './pages/Register.js';
import { ProfileMaker, names, nameCounts } from './components/ProfileMaker.js';
import { VerifyEmail } from './pages/VerifyEmail.js';
import { EmailVerification } from './pages/EmailVerification.js';
import Login from './pages/Login.js';
import Profile from './pages/Profile.js';
import Catalog from './pages/Catalog.js';
import Sell from './pages/Sell.js';

import './index.css';

import reportWebVitals from './reportWebVitals';

// console.log(nameDups.size);

let profileRoutes = [];
for (let name of names) {
  let nameInPath = name.toLowerCase();
  nameInPath = nameInPath.replaceAll(' ', '-');

  if (nameCounts[name] > 1) nameInPath += `-${crypto.randomUUID()}`;

  console.log(nameInPath);

  profileRoutes.push(
    <Route
      path={`/profile/${nameInPath}`}
      element={<Profile nameOfUser={name} />}
    />
  );
}
